    return (
        <Button
style={{
    width: "100%",
    height: "42px",
    marginTop: "10px",
    display: "flex",
    alignItems: "center",
    justifyContent: "flex-start",
    textTransform: "none",
    color: "black",
    position: "relative",

}}
        >

            <Avatar username={username}/>
            <Typography
            style={{
                marginLeft: "7px",
                fontWeight:700
            }}
            >
                { username }
            </Typography>

        </Button>
    )
}

export default FriendsListItems
